def check_min_shifts(allocation, min_shifts):
    num_officers = len(allocation)
    num_companies = len(allocation[0])
    num_days = len(allocation[0][0])
    num_shifts = len(allocation[0][0][0])

    for officer in range(num_officers):
        total_shifts = 0
        for company in range(num_companies):
            for day in range(num_days):
                for shift in range(num_shifts):
                    if allocation[officer][company][day][shift] == 1:
                        total_shifts += 1
        if total_shifts < min_shifts:
            return False
    return True


def check_max_days(allocation, max_days):
    num_officers = len(allocation)
    num_companies = len(allocation[0])
    num_days = len(allocation[0][0])
    num_shifts = len(allocation[0][0][0])

    for officer in range(num_officers):
        for company in range(num_companies):
            working_days = set()
            for day in range(num_days):
                for shift in range(num_shifts):
                    if allocation[officer][company][day][shift] == 1:
                        working_days.add(day)
            if len(working_days) > max_days:
                return False
    return True


def check_officer_preferences(allocation, officer_preferences):
    num_officers = len(allocation)
    num_companies = len(allocation[0])
    num_days = len(allocation[0][0])
    num_shifts = len(allocation[0][0][0])

    for officer in range(num_officers):
        for company in range(num_companies):
            for day in range(num_days):
                for shift in range(num_shifts):
                    if allocation[officer][company][day][shift] == 1 and officer_preferences[officer][shift] == 0:
                        return False
    return True


def check_company_preferences(allocation, company_preferences):
    num_officers = len(allocation)
    num_companies = len(allocation[0])
    num_days = len(allocation[0][0])
    num_shifts = len(allocation[0][0][0])

    for company in range(num_companies):
        for day in range(num_days):
            for shift in range(num_shifts):
                required_officers = company_preferences[company][shift]
                allocated_officers = sum(
                    allocation[officer][company][day][shift] for officer in range(num_officers))
                if allocated_officers != required_officers:
                    print(f"Company {company}, Day {day}, Shift {shift}:")
                    print(f"  Required officers: {required_officers}")
                    print(f"  Allocated officers: {allocated_officers}")
                    print("  Allocated officer(s):")
                    for officer in range(num_officers):
                        if allocation[officer][company][day][shift] == 1:
                            print(f"    - Officer {officer}")
                    return False
            return True
    

